import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './views/Home';
import CaducidadResults from './views/caducidad_cit_con_riesgo_vivo_sin_mora_results';
import ResumenOperacionesResult from './views/resumen_operaciones_results';
import DesbloquearUsuario from "./views/desbloquear_usuario_g3";
import ConsultaG3 from './views/consulta_g3';
import ConsultaG3Resultado from './views/ConsultaG3Resultado';
import Login from './views/login';  
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <h1>Consultas a Bases de datos</h1>
        <Routes>
          {/* <Route path="/" element={<Login />} /> */}
          <Route path="/" element={<Home />} />
          <Route path="/resultados" element={<CaducidadResults />} />
          <Route path="/resumen_operaciones" element={<ResumenOperacionesResult />} />
          <Route path="/desbloquear_usuario_g3" element={<DesbloquearUsuario />} />
          <Route path="/consulta_g3" element={<ConsultaG3 />} />
          <Route path="/consulta_g3_resultado" element={<ConsultaG3Resultado />} />
          {/* si más vistas tienen página de resultados, añádelas aquí */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
